function minLex(a, b) {
  var result = [];
  while (a.length > 0 && b.length > 0) {
      if (compare(a, b) < 0) {
          result.push(a[0]);
          a = a.slice(1);
      } else {
          result.push(b[0]);
          b = b.slice(1);
      }
  }

  return result.concat(a, b).join("");
}

function compare(a, b) {
  a = a + "~";
  b = b + "~"
  if (a === b) {
      return 0;
  } else {
      return a < b ? -1 : 1;
  }
}

function merge(A, B) {
  const m = A.length;
  const n = B.length;
  let i = 0;
  let j = 0;
  let merged = [];
  while (i < m && j < n) {
    if (A[i] < B[j]) {
      merged.push(A[i])
      i += 1
    } else if (A[i] > B[j]) {
      merged.push(B[j])
      j += 1
    } else  {
      let ii = i;
      let jj = j; 
      let c = A[ii];
      while (ii < m && jj < n && A[ii] === B[jj]) {
        if (A[ii] > c) {
          merged = [...merged, ...A.substring(i, ii)];
          merged = [...merged, ...B.substring(j, jj)];
          // merged.append(A[i:ii])
          // merged.append(B[j:jj])
          i = ii
          j = jj
          c = A[ii]
        }
        ii += 1
        jj += 1
      }
      if (ii === m) {
        merged.push(B[j])
        j += 1;
      } else if (jj === n) {
        merged.push(A[i])
        i += 1
      } else {
        if (A[ii] < B[jj]) {
          merged.push(A[i])
          i += 1
        } else {
          merged.push(B[j])
          j += 1
        }
      }
    }
  }
  return [...merged, ...A.substring(i), ...B.substring(j)].join('');
}

